import axios from "axios";

class App extends React.Component {
  state = {
    users: [],
    username: "",
    email: "",
  };

  componentDidMount = () => {
    this.getBlogPost();
  };

  getBlogPost = () => {
    axios
      .get("/api")
      .then((response) => {
        const data = response.data;
        this.setState({ data: [...this.state.users] });
        console.log("Data has been recieved");
        console.log(data);
      })
